import React, { Component } from 'react'
import { Navbar, NavbarBrand, Jumbotron } from 'reactstrap';

class Header extends Component{
    render(){
        return(
            
            //react fragment to group together a bunch of react elements and then return it
            //use react fragment so that we don't have to add extra node into DOM
            //add react elements directly into the DOM
            <React.Fragment>
                <Navbar dark>
                    <div className="container">
                        <NavbarBrand href="/">Ristorante Con Fusion</NavbarBrand>
                    </div>
                </Navbar>
                <Jummbotron>
                    <div className="container">
                        <div className="row row-header">
                            <div className="col-12 col-sm-6">
                                <h1>Ristorante Con Fusion</h1>
                                <p>We take inspiration from the world's best cuisines,
                                 and create a unique fusion experience. Our lipsmacking creations will tickel your culinary senses</p>
                            </div>
                        </div>
                    </div>
                </Jummbotron>
            </React.Fragment>
    
        );
    }
}

export default Header;
